class FenwickTree:
    def __init__(self, n):
        self.tree = [0] * (n + 1)
    
    def update(self, i, delta):
        i += 1
        while i < len(self.tree):
            self.tree[i] += delta
            i += i & -i
    
    def prefix_sum(self, i):
        i += 1
        sum = 0
        while i > 0:
            sum += self.tree[i]
            i -= i & -i
        return sum


class Solution:
    def numSubmatrixSumTarget(self, matrix: list[list[int]], target: int) -> int:
        ylen = len(matrix)
        xlen = len(matrix[0])

        # split matrix input into list of lists consisting of int values
        # flatmatrix = [int(x) for sub_list in matrix for x in sub_list]
        # print(flatmatrix)

        out = 0
        res = {}

        # print("Before:", flatmatrix)
        # new_row = False
        # for i, v in enumerate([int(x) for sub_list in matrix for x in sub_list][1:]):
        #     if i % (xlen -1) == 0:
        #         new_row = True
        #     else:
        #         new_row = False

        #     flatmatrix[i] += flatmatrix[i - 1] if not new_row else 0
        # print("After:", flatmatrix)


        # vertical prefixsum
        for j in range(ylen):
            for i in range(1, ylen):
                matrix[i][j] += matrix[i - 1][j]

        # horizontal prefixsum
        for i in range(xlen):
            for j in range(1, xlen):
                matrix[i][j] += matrix[i][j - 1]


        # print("Before:", matrix)
        # for row in matrix:
        #     for col in range(1, xlen):
        #         row[col] += row[col - 1]
        # print("After:", matrix)


        for j in range(xlen):
            for k in range(j, xlen):
                res = {0: 1}
                csum = 0

                for i in range(ylen):
                    csum += matrix[i][k] - (matrix[i][j - 1] if j else 0)
                    out += res.get(csum - target, 0)
                    res[csum] = res.get(csum, 0) + 1

        return out


def submatrix_sums(matrix):
    # Initialize a list to store the sums of all submatrices
    submatrix_sums = 0
    
    # Create a list to store the row prefix sums
    row_sums = [[0] * len(matrix[0]) for _ in range(len(matrix))]
    for row in range(len(matrix)):
        for col in range(len(matrix[0])):
            row_sums[row][col] = matrix[row][col]
            if col > 0:
                row_sums[row][col] += row_sums[row][col - 1]
    
    # Iterate over all possible starting rows of the submatrix
    for start_row in range(len(matrix)):
        # Iterate over all possible ending rows of the submatrix
        for end_row in range(start_row, len(matrix)):
            # Initialize the sum of the current submatrix to 0
            submatrix_sum = 0
            # Initialize the sum of the current row to 0
            row_sum = 0
            # Iterate over all possible starting and ending columns of the submatrix
            for start_col in range(len(matrix[0])):
                for end_col in range(start_col, len(matrix[0])):
                    # Update the sum of the current submatrix
                    submatrix_sum += row_sum
                    if start_row > 0:
                        submatrix_sum -= row_sums[start_row - 1][end_col]
                    if start_col > 0:
                        submatrix_sum += row_sums[end_row][start_col - 1]
                        if start_row > 0:
                            submatrix_sum += row_sums[start_row - 1][start_col - 1]
                    # Add the sum of the current submatrix to the list
                    if submatrix_sum == target:
                        submatrix_sums += 1

                # Update the sum of the current row
                row_sum += matrix[end_row][end_col]
                if start_row > 0:
                    row_sum -= matrix[start_row - 1][end_col]
    
    # Return the list of submatrix sums
    return submatrix_sums


